Two versions of one model<p>This is a bit weird but I need to have two versions of the same model in node.js. I'm gonna try to do my best explaining.</p>

<p>I have to create two different acc types based on the fact if they're a job seeker or an employer. The fields are quite different and I cannot really change them.</p>

<pre><code>var mongoose = require('mongoose');
var plm = require('passport-local-mongoose');
var accountSchema = new mongoose.Schema({
  username: String,
  accType: String,
  companyName: String,
  contactPersonFullName: String,
  email: String,
  companyWebsite: String,
  city: String,
  province: String,
  postalCode: String,
  phoneNumber: String,
  hiringRegion: String[], // TODO
  description: String,
  logo: String, //TODO
  workingWithEOESC: Boolean,
  industry: String,
});
accountSchema.plugin(plm);
module.exports = mongoose.model('account-employer', accountSchema);
</code></pre>

<p>This ^ is my employer account model. And this is my job seeker model:</p>

<pre><code>var mongoose = require('mongoose');
var plm = require('passport-local-mongoose');
var accountSchema = new mongoose.Schema({
  username: String,
  accType: String,
  city: String,
  province: String,
  postalCode: String,
  phone: String,
  ageGroup: String,
  education: String,
  lookingForWork: Boolean,
  employmentStatus: String,
  workingWithEOESC: Boolean,
  resume: String, //TODO
  mainWorkExp: String,
});
accountSchema.plugin(plm);
module.exports = mongoose.model('account-seeker', accountSchema);
</code></pre>

<p>I thought this is a good idea, but then I realized I need <code>one</code> account model, because of how <code>passport</code> works in Express. How can I make sure that different user types have different fields and info in the NoSQL db while keeping one account to log in and register? I might be making no sense now but I cannot see a way out of this situation.</p>

