How to make a mongoose find query return null instead of throwing a CastError when the types are incompatible?<h1>Problem</h1>

<p>When using mongoose to find documents by a specific field, if the type of the field is different from the type of the queried value, then mongoose will attempt to cast the query value to the same type as the field.</p>

<p>However, if the value cannot be casted, then mongoose will throw a <code>CastError</code>.</p>

<p>This behavior can be seen in the following example, where mongoose will attempt to cast the string <code>'invalid object id'</code> to an <code>ObjectId</code> when trying to query for <code>Foo</code> documents by the <code>bar</code> field:</p>

<pre><code>const fooSchema = new mongoose.Schema({
  bar: {
    type: mongoose.Schema.Types.ObjectId,
  }
});
const Foo = &lt;any&gt;mongoose.model&lt;any&gt;('Foo', fooSchema);
await Foo.findOne({ bar: 'invalid object id' });
</code></pre>

<blockquote>
  <p>UnhandledPromiseRejectionWarning: Unhandled promise rejection
  (rejection id: 1): CastError: Cast to ObjectId failed for value
  "invalid object id" at path "bar" for model "Foo"</p>
</blockquote>

<p><em>(Similar error would occur if <code>bar</code> was some other types, such as <code>Number</code> or <code>Boolean</code> as well.)</em></p>

<p>However, I don't like this behaviour. I very much prefer that the returned document simply becomes <code>null</code>, without an error being thrown. After all, if the value in the query cannot be casted, then the document logically also cannot exist under the given query. </p>

<p>Now, I am aware that I can simply do a check before constructing the query to ensure that I don't pass in a type that can't be casted. However, I don't like this approach because it results in having to duplicate code. Quite often, the code to handle what happens when the type is invalid will be exactly the same as the code to handle what happens if the document does not exist.</p>

<p>Additionally, I don't want to disable type checking completely either. So changing the type of the field to <code>Mixed</code> would not be a solution, as I would like the type check to still be there when I am creating a new document.</p>

<h1>Attempted Solutions</h1>

<p>So I attempted to solve this issue by creating custom <a href="http://mongoosejs.com/docs/guide.html#query-helpers" rel="nofollow noreferrer">query helpers</a> to check the type, and return null if it is invalid, or perform the query if it is valid.</p>

<pre><code>fooSchema.query.byBar = function(id) {
  if (!mongoose.Types.ObjectId.isValid(id)) {
    return null;
  }

  return this.where('bar').equals(id);
};
</code></pre>

<p>Which I can then use with <code>Foo.findOne().byBar('invalid object id')</code>.</p>

<p>The problem with this solution however, is that it is no longer chainable. This means that if I were to try something such as <code>Foo.findOne().byBar('invalid object id').lean()</code>, it will throw an error if the type check fails (but will work fine when it passes the type check):</p>

<blockquote>
  <p>UnhandledPromiseRejectionWarning: Unhandled promise rejection
  (rejection id: 1): TypeError: Cannot read property 'lean' of null</p>
</blockquote>

<p>Trying to use static methods instead will run into the same problem.</p>

<pre><code>fooSchema.statics.findOneByBar = function(id: any) {
  if (!mongoose.Types.ObjectId.isValid(id)) {
    return null;
  }

  return this.findOne({ bar: id });
};
</code></pre>

<h1>Question</h1>

<p>So essentially, I want to be able to have the query return <code>null</code> if the type check fails, but still be chainable. I want the query to be chainable because I still want to be able to specify additional query conditions in the cases where the type is valid. </p>

<p>Now, if my attempted solution is on the right track, then what I need to do is instead of returning <code>null</code> directly if the type check fails, I return something from the chainable query builder api that will result in the query's final result to be <code>null</code>. I essentially need some sort of <a href="https://stackoverflow.com/questions/32359076/how-can-i-query-1-1-or-1-0-in-mongo"><code>1=0</code> query condition</a> (however, the linked question did not propose a guaranteed answer for the <code>1=0</code> condition). So my question is, <strong>if my attempted solution is on the right track, then what do I return that is a chainable mongoose Query, but will cause the query to always result in <code>null</code> when the query is executed?</strong></p>

<p>Or alternatively, <strong>if my attempted solution is on the wrong track, is there another way to make a mongoose find query result in <code>null</code> instead of throwing a <code>CastError</code> when the types are incompatible?</strong></p>

