MongoDB match criteria in aggregate acting unexpectedly<p>I am currently working with a collections with documents like this</p>

<pre><code>{
    "_id": {
        "$oid": "5aa8665dcfe5305814e6dd90"
    },
    "userID": "5aa71af7b562de0c690eb6e0",
    "rebate": 64,
    "status": "approved"
}
</code></pre>

<p>The query I am running is as follows:</p>

<pre><code>var id = "5aa71af7b562de0c690eb6e0";

Warranty.aggregate(
    [
        {
            $match: {
                "userID": id,
                "status": "approved"
            }
       },
       {
           $group: {
               "_id": null,
               "total": {
                   $sum: "$rebate"
               }
          }
      }
    ], function(err, sum) {

        if (err) throw err;

        res.send(sum);

});
</code></pre>

<p>Currently, this is returning <code>[]</code></p>

<p>The expected result is <code>[ { "_id": null, "total": 64 } ]</code></p>

<p>I have also attempted to cast the variable id to ObjectId like so:</p>

<p><code>"userID": mongoose.Types.ObjectId(id)</code> and the result is still an empty array.</p>

<p>The interesting thing is if I remove the match "userID" line this works and returns <code>[ { "_id": null, "total": 64 } ]</code> but I need this to limit the query to the active user only.</p>

<p>I am new to Mongo aggregate.</p>

<h2>Possible solution</h2>

<p>For some reason doing this <code>"userID": id + '',</code> fixes the issue.  I don't really understand why; would anyone explain to me why this is the case? I would assume since the id is comprised of alpha-numeric characters that it would already be a string, right?</p>

