How to fetch data from MongoDB collection in C# using Regular Expression?<p>I am using <code>MongoDB.Drivers</code> nuget package in my <code>MVC (C#)</code> web application to communication with MongoDB database. Now, I want to fetch data based on specific column and it's value. I used below code to fetch data.</p>

<pre><code>var findValue = "John";
                var clientTest1 = new MongoClient("mongodb://localhost:XXXXX");
                var dbTest1 = clientTest1.GetDatabase("Temp_DB");
                var empCollection = dbTest1.GetCollection&lt;Employee&gt;("Employee");
                var builder1 = Builders&lt;Employee&gt;.Filter;
                var filter1 = builder1.Empty;
                var regexFilter = new BsonRegularExpression(findValue, "i");
                filter1 = filter1 &amp; builder1.Regex(x =&gt; x.FirstName, regexFilter);
                filter1 = filter1 &amp; builder1.Eq(x =&gt; x.IsDeleted,false);
                var collectionObj = await empCollection.FindAsync(filter1);
                var dorObj = collectionObj.FirstOrDefault();
</code></pre>

<p><strong>But,</strong> the above code is performing <code>like</code> query.
It means it is working as (<code>select * from Employee where FirstName like '%John%'</code>) I don't want this. I want to fetch only those data whose <code>FirstName</code> value should match exact. (like in this case FirstName should equal <code>John</code>).</p>

<p>How can I perform this, can anyone provide me suggestions on this.</p>

<p><strong>Note:</strong>  I used <code>new BsonRegularExpression(findValue, "i")</code> to make search <code>case-insensitive</code>.</p>

<p>Any help would be highly appreciated.</p>

<p>Thanks</p>

