how to write the single aggregation in the query<p>I am writing the first query greater than equal to CREATE_DATE and less then CREATE_DATE I got the answer ofter calculate the duration write another query but how to write the single query in the aggregation.</p>

<blockquote>
  <p>Query 1</p>
</blockquote>

<pre><code>db.lights.aggregate({
  $match: {
    CREATE_DATE: {
      $gte: ISODate("2018-01-24T20:05:30.000Z"),
      $lt: ISODate("2018-02-24T20:05:30.000Z")
    }
  }
});
</code></pre>

<p><strong>Result</strong></p>

<pre><code>{
  "_id": ObjectId("5a9a74843711955836a8b4b5"),
  "SWITCHID": "Z4-W40-SS451A/4",
  "CREATE_DATE": ISODate("2018-01-24T20:05:30Z"),
  "RECEIVEDDATE": ISODate("2018-02-24T20:05:45Z"),
  "STATUS": "LIGHTS ON"
}
</code></pre>

<blockquote>
  <p>Query 2</p>
</blockquote>

<pre><code>db.lights.aggregate([
  {
    $addFields: {
      offduration: {
        $divide: [
          {
            $subtract: [
              "$RECEIVEDDATE",
              "$CREATE_DATE"
            ]
          },
